import React from "react";
import "./Header.css"
import  profile  from "../../assets/profile.png";

const Header = () => {

  const languages = [
    {
      id:1,
      link:"https://cdn.jsdelivr.net/gh/devicons/devicon/icons/csharp/csharp-original.svg",
      alt: "csharp_icon"

    },
    {
      id:2,
      link:"https://cdn.jsdelivr.net/gh/devicons/devicon/icons/java/java-original-wordmark.svg",
      alt: "java_icon"

    },
    {
      id:3,
      link:"https://cdn.jsdelivr.net/gh/devicons/devicon/icons/python/python-original-wordmark.svg",
      alt: "python_icon"

    },
    {
      id:4,
      link:"https://cdn.jsdelivr.net/gh/devicons/devicon/icons/javascript/javascript-original.svg",
      alt: "javascript_icon"

    },
    {
      id:5,
      link:"https://cdn.jsdelivr.net/gh/devicons/devicon/icons/css3/css3-original.svg",
      alt: "css_icon"

    },
    {
      id:6,
      link:"https://cdn.jsdelivr.net/gh/devicons/devicon/icons/html5/html5-original.svg",
      alt: "html_icon"

    },
    {
      id:7,
      link:"https://cdn.jsdelivr.net/gh/devicons/devicon/icons/react/react-original-wordmark.svg",
      alt: "react_icon"

    },

  ]


  return (
    <div className="Header">


      <div className="Profile">
          <img src={profile} alt="profile"/>
          <div className="Profile_text">
            <h3 data-testid ="name">Mxolisi Magubane</h3>
            <p data-testid ="bio_description">Hello, World!</p>
          </div>  
      </div>

      <div className="Summary">
        <h2>Summary</h2>
        <hr className="Line"/>
        <p>I am a Graduate Software Engineer skilled in C#, Java, Python, and {'\n'}web development. I have a keen eye for
          detail and love creating clean and efficient code. {'\n'} I am always eager to expand my knowledge in the field of software
          engineering.  {'\n'}I do not mind digging into boring work as more often than not it is where the details that matter are found.</p>
      </div>

      <h2>Skills</h2>
      <hr className="Line"/>

      <div className="Skills_icons">
         {languages.forEach(langauge => {
           <img src={langauge.link} alt={langauge.alt}/>
         })
         }
      </div>

    </div>
  )
}

export default Header
